    false,nt"url": null,nt"notes": "This metadata applies to the following
    collection area(s): Windham County 2015 0.7m and related "normalized" Digital
    Surface Model (nDSM). Created "Normalized Digital Surface Modelu00e2u0080u009d
    (nDSM) using the ArcGIS "MINUS" command where each pixel represents the height
    above ground (not above sea level) and is calculated by subtracting the DEM from
    the DSM, with vertical units in meters. This metadata complies with the VT Geodata
    Portal format and applies to thematic layers with the same resolution (RESCLASS),
    e.g., 0p7m, 1m etc., and may include multiple data "collection" efforts. For the
    original vendor metadata containing specific details on each collections "point
    cloud" such as flight dates, nominal pulse spacing and RMSEz etc., see the "All
    Available LiDAR" Product page: (http://vcgi.vermont.gov/warehouse/products/ALL-LDR_MIX_LIDAR_STATE_ALL).
